package al.assu.trust.GestionImageSinistre.domain;

public class Sysfacus {
	public Sysfacus() {
		// TODO Auto-generated constructor stub
	}

	private String To;
	private String lia;
	private String avglia;
	private int nbr;
	private String sum;
	private String From;

	public String getLia() {
		return lia;
	}

	public void setLia(String lia) {
		this.lia = lia;
	}

	public String getAvglia() {
		return avglia;
	}

	public void setAvglia(String avglia) {
		this.avglia = avglia;
	}

	public int getNbr() {
		return nbr;
	}

	public void setNbr(int nbr) {
		this.nbr = nbr;
	}

	public String getSum() {
		return sum;
	}

	public void setSum(String sum) {
		this.sum = sum;
	}

	public String getTo() {
		return To;
	}

	public void setTo(String to) {
		To = to;
	}

	public String getFrom() {
		return From;
	}

	public void setFrom(String from) {
		From = from;
	}

}
